import ReactDom from "react-dom/client"
import './style.css'

const root=ReactDom.createRoot(document.getElementById("root"))


//navbar//

function Navbar(){

return(<div id="navbar">

  <h1>Perfumy</h1>
  <ul>

    <li>Home</li>
    <li>Products</li>
    <li>Contact</li>
  </ul>

</div>
)

}

root.render(


  <div>

    <Navbar> </Navbar>
  </div>
)
